import React from "react";

import Card from "react-bootstrap/Card";

const SolInstEvent = ({ event }) => {
  return (
    <div>
      <Card>
        <Card.Header className="cardTitle">{event.name}</Card.Header>
      </Card>
    </div>
  );
};

export default SolInstEvent;
